import Header from '../components/Header';
import VideoGenerator from '../components/VideoGenerator';

export default function Home() {
  return (
    <div className="min-h-screen p-8">
      <Header />
      <main className="space-y-8">
        <VideoGenerator />
      </main>
    </div>
  );
}
